import React, { Component } from 'react';
import {NavItem} from 'react-bootstrap';
class Info_user extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }
    render() {
        return (
            <div>
                {this.props.login===true?<NavItem>Login/Registor</NavItem>:<NavItem>Login Successful</NavItem>}
            </div>
        );
    }
}

export default Info_user;
